  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:54.524323\",\n\t\"name\": \"narrative-report-september-october-november-december-1950-lostwood-national-wildlife-refug\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lostwood National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1950. The report begins by summarizing the weather conditions, water conditions,
  food and cover, and wildfires during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Resource management is outlined; topics include
  grazing, haying, and fur harvesting. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and hunting. Items of
  interest and N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
